        React.createElement("path", { d: "M4 11a5 5 0 005 5h4.5a.5.5 0 000-1H9a4 4 0 010-8h5.3l-2.7 2.7a.5.5 0 10.7.7l3.54-3.53a.5.5 0 00.13-.5.5.5 0 00-.14-.25L12.3 2.6a.5.5 0 10-.71.7L14.29 6H9a5 5 0 00-5 5z", fill: primaryFill }));
};
